import React from 'react'
import CartItem from './CartItem'

const ShoppingCart = ({ cart}) => {


  return (
    <div className="cart">
      <h2>Your Cart</h2>
      <div>
        {cart.map(item =>(
          <CartItem key={item.id} {...item} />
        ))}
      </div>
    </div>
  )
}

export default ShoppingCart;
